INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", 102601, 1, 0.0, "リン", 0, 1, 24001, 10040, 24, "2030/12/17 14:59:59", "あたしだって\nやるときはやるよ！", 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", 102601, 1, 0.0, "リン", 1, 1, 24002, 10040, 24, "2030/12/17 14:59:59", "ふぅ…\nこれであたしの仕事は\n終わりだね", 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", 102601, 1, 0.0, "リン", 2, 1, 24003, 10040, 24, "2030/12/17 14:59:59", "終わった終わった\n一人でもなんとか\nなるもんだね", 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", 102601, 2, 0.0, "リン", 3, 2, 24004, 10040, 24, "2030/12/17 14:59:59", "やったね！\nこれでようやく\nサボれるよ…", 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", 102601, 1, 0.0, "リン", 4, 1, 24005, 10040, 24, "2030/12/17 14:59:59", "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", 102601, 2, 0.0, "リン", 5, 2, 24006, 10040, 24, "2030/12/17 14:59:59", "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", 102601, 2, 0.0, "リン", 6, 2, 24007, 10040, 24, "2030/12/17 14:59:59", "あたしも意外と\nやるもんでしょ？", 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", 102601, 4, 0.0, "リン", 7, 4, 24008, 10040, 24, "2030/12/17 14:59:59", "疲れた…\nねずみの逃げ足\n速すぎるよ…", 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", 102601, 4, 0.0, "リン", 8, 4, 24009, 10040, 24, "2030/12/17 14:59:59", "このままじゃ\nまっひ～に\n叱られちゃうよ", 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", 102601, 4, 0.0, "リン", 9, 4, 24010, 10040, 24, "2030/12/17 14:59:59", "まじめに\nやったんだけどな…\n悔しいな～", 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", 102601, 4, 0.0, "リン", 10, 4, 24011, 10040, 24, "2030/12/17 14:59:59", "やられた…\nねずみって意外と\nてごわいね", 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", 102601, 4, 0.0, "リン", 11, 4, 24012, 10040, 24, "2030/12/17 14:59:59", "おのれ～\nあたしのチーズを\n盗みやがって～！", 0.0, 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("2020/04/30 12:00:00", 102601, 1, 0.0, "リン", 12, 4, 24013, 10040, 24, "2030/12/17 14:59:59", "疲れた…\nけど、次こそは\n守り抜くよ…", 1.81, 0.0);
